import React, { useState } from "react";

import "./style-profile.css";
import Header from "../../components/Header";
import Footer from "../../components/Footer";
import AboutButton from "../../components/btns/AboutButton";
import ContactButton from "../../components/btns/ContactButton";
import TempoGoals from "./mains/TempoGoals";
import ContGoalsTD from "./mains/ContGoalsTD";
import ContGoalsAD from "./mains/ContGoalsAD";
import LimitedActivities from "./mains/LimitedActivities";
import ForbiddenActivities from "./mains/ForbiddenActivities";
import SocialGatherings from "./mains/SocialGatherings";
import SignUpBtn from "../../components/btns/SignUpBtn";
import LoginBtn from "../../components/btns/LoginBtn";
import ForumBtn from "../../components/btns/ForumBtn";
import Ideas from "./mains/Ideas";

function Profile() {
  const tempoGoalsData = [
    {
      goal: "Change career path",
      action: "Study and get a coding job",
      id: 0.7419944699444685,
    },
    {
      goal: "Linda's present",
      action: "Check a concert to go",
      id: 0.7419944699232888,
    },
    {
      goal: "Taxes",
      action: "Wait for Tiberio",
      id: 0.7419222699444444,
    },
    {
      goal: "1kg dumbbells",
      action: "Go to Decathlon",
      id: 0.7419222699444333,
    },
    {
      goal: "iPhone stand",
      action: "Buy in Amazon",
      id: 0.7419222699444222,
    },
    {
      goal: "Belen bills",
      action: "Pay 5 of them at the end of the month",
      id: 0.7419222699444222,
    },
    {
      goal: "Fighter hair",
      action: "Cut hair to have better sight",
      id: 0.7419222699444222,
    },
  ];
  const contGoalsTDData = [
    {
      goal: "Meditate",
      freq: "Daily",
      length_: "15 minutes",
      id: 0.0919944699284685,
    },
  ];
  const contGoalsADData = [
    {
      goal: "MT schedule",
      freq: "Weekly",
      length_: "Book next week MT",
      id: 0.2219945439284685,
    },
  ];
  const limitedActivitiesData = [
    {
      goal: "Instagram",
      freq: "Daily",
      length_: "One second",
      id: 0.2215648439284685,
    },
    {
      goal: "Facebook",
      freq: "Daily",
      length_: "One second",
      id: 0.2215648555284685,
    },
  ];
  const forbiddenActivitiesData = [
    { goal: "Youtube", action: "Post MT", id: 0.7419944699444685 },
    { goal: "Phone", action: "Post MT", id: 0.7419576869444685 },
  ];
  const socialGatheringsData = [
    {
      goal: "Tim Hecker's gig",
      freq: "18.04.2023",
      length_: "With Javilondon",
      id: 0.2215648439284685,
    },
  ];
  const ideasData = [
    { goal: "Healthy gatherings", action: "Activites that are not related to nightlife/bars etc.", id: 0.7415556799444685 },
    { goal: "Phone", action: "Post MT", id: 0.7419576869444685 },
  ];

  const repTitles = ["Goal", "Add/Remove", "How often?"];
  const titles3col = [
    {
      type: "temporary goals",
      col1: repTitles[0],
      col2: "What has to happen to accomplish it?",
      col3: repTitles[1],
    },
    {
      type: "forbidden activities",
      col1: repTitles[0],
      col2: "Until when?",
      col3: repTitles[1],
    },
  ];
  const titles4col = [
    {
      type: "cont. goals (time dependent)",
      col1: repTitles[0],
      col2: repTitles[2],
      col3: "For how long?",
      col4: repTitles[1],
    },
    {
      type: "cont. goals (action dependent)",
      col1: repTitles[0],
      col2: repTitles[2],
      col3: "Which action?",
      col4: repTitles[1],
    },
    {
      type: "limited activities",
      col1: "Activity",
      col2: repTitles[2],
      col3: "Daily time allowed",
      col4: repTitles[1],
    },
    {
      type: "forbidden activities",
      col1: "Activity",
      col2: "For how long?",
      col3: repTitles[1],
    },
    {
      type: "social gatherings",
      col1: "Event",
      col2: "Date",
      col3: "Notes",
      col4: repTitles[1],
    },
  ];

  return (
    <div>
      <Header
        altBtn1={ForumBtn}
        altBtn2={ForumBtn}
        altBtn3={AboutButton}
      ></Header>
      <main className="main-profile-container">
        <TempoGoals
          dataTunnel={tempoGoalsData}
          titlesTunnel={titles3col}
        ></TempoGoals>
        <ContGoalsTD
          dataTunnel={contGoalsTDData}
          titlesTunnel={titles4col}
        ></ContGoalsTD>
        <ContGoalsAD
          dataTunnel={contGoalsADData}
          titlesTunnel={titles4col}
        ></ContGoalsAD>
        <LimitedActivities
          dataTunnel={limitedActivitiesData}
          titlesTunnel={titles4col}
        ></LimitedActivities>
        <ForbiddenActivities
          dataTunnel={forbiddenActivitiesData}
          titlesTunnel={titles4col}
        ></ForbiddenActivities>
        <SocialGatherings
          dataTunnel={socialGatheringsData}
          titlesTunnel={titles4col}
        ></SocialGatherings>
        <Ideas dataTunnel={ideasData} titlesTunnel={titles3col}></Ideas>
      </main>
      <Footer></Footer>
    </div>
  );
}

export default Profile;
